property.code:
document.observe('xwiki:dom:loaded', function()
{
  if ($('saveratingsactivation')) {
    Event.observe($('saveratingsactivation'), 'click', function(event) {
      event.stop();

      if ($('activateratings').checked) {
        var url = "$xwiki.getURL('XWiki.AdminRatingsSheet', 'view', 'outputSyntax=plain&xpage=plain&saveratingsactivation=Save&activateratings=on')";
      }
      else {
        var url = "$xwiki.getURL('XWiki.AdminRatingsSheet', 'view', 'outputSyntax=plain&xpage=plain&saveratingsactivation=Save&activateratings=off')";
      }
      new Ajax.Request(url, {
        method: 'get',
        onLoading: function() {
          $('activationstatus').innerHTML = "$msg.get('admin.ratings.activating')";
        },
        onSuccess: function(transport)
        {
          $('activationstatus').innerHTML = transport.responseText;
        }
      });
    });
  }
});

#ratingsactivation fieldset p label.ratings{
  float:none;
}
#ratingsactivation .bottombuttons {
  text-align: left;
}
